CREATE trigger audit_aliqstorage
before insert on aliquot_audit
for each row
begin
if new._audit_change_type= 'I' then
select id into @aliq_id
from aliquot
where aliquot.genealogyID= new.genealogyID and endTimestamp is null;
set new.id=@aliq_id;
END if;
END ;;
